define('app/messages', [], function () {
    return {
        getHello: function () {
            return 'Hello World!!';
        }
    };
});
define('print', function () {
    return function print(msg) {
        console.log(msg);
    };
});
define('lib/print', [], function () {
    return;
});
define('app/main', [
    'app/messages',
    'lib/print'
], function (require) {
    var messages = require('./messages');
    var print = require('../lib/print');
    print(messages.getHello());
});
requirejs.config({
    baseUrl: '/assets/lib',
    paths: { app: '/assets/app' }
});
requirejs(['app/main']);
define('app', ['app/main'], function () {
    return;
});